import React, { Component } from 'react';
export default class Car extends Component{
	
	constructor(props) {
		super(props);
		this.state = {brand: "Ford"};
    }
	render() {
    return (
      <div>
        <h1>My Car {this.state.brand}</h1>
      </div>
    );
	}
}
